class LiftConsole extends React.Component {
    render(){
        fetch("localhost:8000/api/lift/request/", {
            method: "GET",
            headers: {},
          })
          .then((response) => response.json())
          .then((data) => {
            console.log("test" + data);
          })
          .catch((error) => console.log(error));
        return (<p>Testing</p>);
    }
}

export default LiftConsole;
